// src/App.js

import React from 'react';
import TicketForm from './components/TicketForm';
import TicketList from './components/TicketList';

function App() {
  return (
    <div>
      <h1>Support Ticket Management System</h1>
      <TicketForm />
      <hr />
      <TicketList />
    </div>
  );
}

export default App;
